function sendMail(l){"use strict";return emailjs.send("gmail","contact_form",{full_name:l.full_name.value,email:l.email.value,project_title:l.project_title.value,project_idea:l.project_idea.value}).then(function(l){console.log("Success",l),$("#thank-you").show(40,function(){$("#contact-form").hide(1),$("#full_name").val(null),$("#email").val(null),$("#project_title").val(null),$("#project_idea").val(null)})},function(l){console.log("failed",l),$("#error").show(40,function(){$("#contact-form").hide(1),$("#full_name").val(null),$("#email").val(null),$("#project_title").val(null),$("#project_idea").val(null)})}),!1}